import React from "react"
import {useSelector} from "react-redux"

//components

const LeftFeed = () => {
  let users = []
  const getDataFromApi = () => {
    axios
      .get("https://us-central1-hammer-app.cloudfunctions.net/getUsers")
      .then((res) => {
        const datas = res.data
        users = datas
        return users
      })
      .catch((err) => console.log("Error k aayo:" + err))
  }
  //const users = useSelector((state) => state.getUsersReducer)
  console.log(users)

  return (
    <div className="left-feed">
      <div className="text-bold text-main">Followers</div>
      <p>
        <a href="/">Bikash</a>
      </p>
      <p>
        <a href="/">Arto</a>
      </p>
      <p>
        <a href="/">Joonas</a>
      </p>
    </div>
  )
}

export default LeftFeed
